import React from "react"
import books from "./data";

function Card(){
    return (
        <>
        {books.map((elm, index)=>{
           <div className="Card" key={index}>
                <img src={elm.img} alt="pic" className="card_img"/>
                <div className="card_detail">
                    <h2 className="card_title">{elm.title}</h2>
                    <p className="card_author">{elm.author}</p>
                    <a href={elm.link} target="blank">
                        <button>Buy Now</button>
               </a>
           </div>    
       </div>
        })}
            
        </>
    )
  };

  export default Card;
